import { create } from 'zustand';
import axios from 'axios';

// Set your API endpoints
const USER_API = "http://localhost:5000/auth";
const ADM_API = "http://localhost:5000/admin";

export const useAuthStore = create((set) => ({
    user: null,
    isAuthenticated: false,
    isLoading: false,
    error: null,
    messages: null,
    isCheckingAuth: true,
    message: null,
    setUser: (userData) => set({ user: userData }),
    // Signup method
    signup: async (firstName, lastName, admNo, year, email, password, avatar) => {
        set({ isLoading: true, error: null });
        try {
            const response = await axios.post(`${USER_API}/signup`, { firstName, lastName, admNo, year, email, password, avatar });
            set({ user: response.data.user, isLoading: false, isAuthenticated: true });
        } catch (error) {
            set({ error: error.response?.data?.message || "Error signing up", isLoading: false });
            throw error;
        }
    },

    // Admin Login
    adminLogin: async (email, password) => {
        set({ isLoading: true, error: null });
        try {
            const response = await axios.post(`${ADM_API}/adminLogin`, { email, password });
            set({ admin: response.data.admin, isAuthenticated: true, isLoading: false, error: null });
        } catch (error) {
            set({ error: error.response?.data?.message || "Error logging in", isLoading: false });
            throw error;
        }
    },

    // User Login
    login: async (admNo, password) => {
        set({ isLoading: true, error: null });
        try {
            const response = await axios.post(`${USER_API}/login`, { admNo, password });
            localStorage.setItem("token", response.data.token);
            set({ user: response.data.user, isAuthenticated: true, isLoading: false, error: null });
        } catch (error) {
            set({ error: error.response?.data?.message || "Error logging in", isLoading: false });
            throw error;
        }
    },

    // Logout
    logout: async () => {
        try {
            await axios.post(`${USER_API}/logout`, null, { withCredentials: true });
            localStorage.removeItem("token");
            set({ user: null, isAuthenticated: false, isCheckingAuth: false });
        } catch (error) {
            set({ error: error.response?.data?.message || "Error logging out", isLoading: false });
            throw error;
        }
    },

    // Forgot Password
    forgotPassword: async (email) => {
        set({ isLoading: true, error: null });
        try {
            const response = await axios.post(`${USER_API}/password`, { email });
            set({ message: response.data.message, isLoading: false });
        } catch (error) {
            set({ error: error.response?.data?.message || "Error sending reset password email", isLoading: false });
            throw error;
        }
    },

    // Check Auth Status
    checkAuth: async () => {
        set({ isCheckingAuth: true, error: null });
        try {
            const token = localStorage.getItem("token");
            if (!token) {
                set({ isAuthenticated: false, isCheckingAuth: false });
                return;
            }

            const response = await axios.get(`${USER_API}/check-auth`, {
                headers: { Authorization: `Bearer ${token}` },
                withCredentials: true
            });
            set({ user: response.data.user, isAuthenticated: true, isCheckingAuth: false });
        } catch (error) {
            set({
                isAuthenticated: false,
                isCheckingAuth: false,
                error: error.response?.data?.message || "Failed to authenticate",
            });
        }
    },

    // Get Projects
    getProjects: async () => {
        try {
            const response = await axios.get(`${USER_API}/task/takeTask`);
            set({ tasks: response.data.tasks });
        } catch (error) {
            console.log(error);
        }
    },

    // Post Task
    postTask: async (title, description, date, level) => {
        try {
            const response = await axios.post(`${USER_API}/task/makeTask`, { title, description, date, level });
            set({ task: response.data.task });
        } catch (error) {
            console.log(error);
        }
    },

    // Post Project
    postProject: async (title, description, year, reference) => {
        try {
            const response = await axios.post(`${USER_API}/projects/sendprojects`, { title, description, year, reference });
            set({ project: response.data.project });
        } catch (error) {
            console.log(error.message);
        }
    },
}));
